function Home() {
  return (
    <div className="w-[390px] h-[135px]  text-[24px] text-[#000000] font-semibold ">
      <div className="border-b-[0.5px] border-purple absolute w-[250px] text-sm  h-[28px] ml-[70px] mt-[400px] font-light flex  justify-center ">
        서울시 강남구 강남대로
        <button>
          <img src={dropDown} alt="drop" className="w-[25px] h-[25px] "></img>
        </button>
      </div>
    </div>
  );
}

export default Home;

